import React from 'react';
import s from './Profile.module.css';

const Profile = () => {
    return <div className = {s.content}>
    <div className = 'avafon'>
      <img src = 'https://html5css.ru/css/img_lights.jpg'></img>
    </div>   
    <div className = {s.item}>
      photo + info
    </div> 
    <div>
      my posts
      <div>
      New post
      </div>
    </div>  
  </div>;
}

export default Profile;
